real_t solve_dim30_system( real_t* const A, real_t* const b, int* const rk_perm )
{
real_t det;

int i;
int j;
int k;

int indexMax;

int intSwap;

real_t valueMax;

real_t temp;

for (i = 0; i < 30; ++i)
{
rk_perm[i] = i;
}
det = 1.0000000000000000e+00;
for( i=0; i < (29); i++ ) {
	indexMax = i;
	valueMax = fabs(A[i*30+i]);
	for( j=(i+1); j < 30; j++ ) {
		temp = fabs(A[j*30+i]);
		if( temp > valueMax ) {
			indexMax = j;
			valueMax = temp;
		}
	}
	if( indexMax > i ) {
for (k = 0; k < 30; ++k)
{
	acadoWorkspace.rk_dim30_swap = A[i*30+k];
	A[i*30+k] = A[indexMax*30+k];
	A[indexMax*30+k] = acadoWorkspace.rk_dim30_swap;
}
	acadoWorkspace.rk_dim30_swap = b[i];
	b[i] = b[indexMax];
	b[indexMax] = acadoWorkspace.rk_dim30_swap;
	intSwap = rk_perm[i];
	rk_perm[i] = rk_perm[indexMax];
	rk_perm[indexMax] = intSwap;
	}
	det *= A[i*30+i];
	for( j=i+1; j < 30; j++ ) {
		A[j*30+i] = -A[j*30+i]/A[i*30+i];
		for( k=i+1; k < 30; k++ ) {
			A[j*30+k] += A[j*30+i] * A[i*30+k];
		}
		b[j] += A[j*30+i] * b[i];
	}
}
det *= A[899];
det = fabs(det);
solve_dim30_triangular( A, b );
return det;
}

